import React from 'react';

export default function About() {
  return (
    <div className="max-w-4xl mx-auto p-6 bg-white rounded shadow my-8">
      <h1 className="text-4xl font-bold mb-4">About ExcelAnalyze</h1>
      <p className="text-lg text-gray-700 leading-relaxed">
        ExcelAnalyze is a comprehensive platform designed to help you upload, analyze, and visualize your Excel data with ease. Our powerful tools include interactive 2D and 3D charting and AI-driven insights to help you make data-driven decisions.
      </p>
      <p className="mt-4 text-gray-700">
        Built with the MERN stack (MongoDB, Express, React, Node.js), it offers a secure and user-friendly experience for both individual users and administrators.
      </p>
    </div>
  );
}
